(23, 'The Elder Scrolls V: Skyrim', 'Es un ARPG del tipo mundo abierto desarrollado por Bethesda Game Studios y publicado por Bethesda Softworks. Skyrim es la quinta entrega de la serie The Elder Scrolls de videojuegos de acción y fantasía, y es posterior a The Elder Scrolls IV: Oblivion y predecesor de The Elder Scrolls Online. Skyrim salió a la venta el 11 de noviembre de 2011​ para las plataformas: Microsoft Windows, Xbox 360 y PlayStation 3.', '2011-11-11', 'RPG/Aventura', 'Bethesda', );
INSERT INTO `games` (`gameID`, `name`, `description`, `releaseDate`, `genre`, `developer`, `image`) VALUES
(26, 'Red Dead Redemption 2', 'Es un videojuego de acción-aventura western basado en el drama. Un juego bastante conocido también por sus cantidades de detalles realistas en un mundo abierto y en perspectiva de primera y tercera persona, con componentes para un jugador y multijugador. Fue desarrollado por Rockstar Games. Es la precuela de Red Dead Redemption y el tercer juego de la saga Red Dead. Su fecha de lanzamiento fue el 26 de octubre de 2018 en las consolas PlayStation 4 y Xbox One.', '2018-10-26', 'Western/Aventura', 'Rockstar Games', );
INSERT INTO `games` (`gameID`, `name`, `description`, `releaseDate`, `genre`, `developer`, `image`) VALUES
(27, 'Dark Souls 1', 'Es un juego de rol de acción de 2011 desarrollado por FromSoftware y publicado por Bandai Namco Entertainment. Sucesor espiritual de Demon\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\'s Souls, es el primer juego de la saga Dark Souls. El juego tiene lugar en el reino de Lordran, donde los jugadores asumen el papel de un personaje no muerto maldito que comienza una peregrinación para descubrir su destino.', '2011-09-22', 'Action RPG', 'From Software', );
INSERT INTO `games` (`gameID`, `name`, `description`, `releaseDate`, `genre`, `developer`, `image`) VALUES
(28, 'The Legend of Zelda: Breath of the Wild', 'Es un videojuego de acción-aventura de 2017 de la serie The Legend of Zelda, publicado por Nintendo para las consolas Wii U y Nintendo Switch. Es la decimoctava entrega de la serie y la tercera en utilizar gráficos en alta definición. El jugador controla a Link, que despierta en un mundo postapocalíptico después de estar cien años durmiendo para derrotar a Ganon y salvar al reino de Hyrule.', '2017-03-03', 'Aventura', 'Nintendo', );
INSERT INTO `games` (`gameID`, `name`, `description`, `releaseDate`, `genre`, `developer`, `image`) VALUES
(29, 'Marvel\'s Spider-Man', 'Es un videojuego de acción y aventura basado en el popular superhéroe hómonimo de la editorial Marvel Comics. Fue desarrollado por Insomniac Games y publicado por Sony Interactive Entertainment en exclusiva para la consola PlayStation 4. Se trata del primer videojuego licenciado desarrollado por Insomniac. Su lanzamiento internacional se produjo el 7 de septiembre de 2018. El juego narra una historia completamente original de Spider-Man que no está ligada a películas o cómics anteriores.', '2018-09-07', 'Acción/Aventura', 'Insomniac Games', );
INSERT INTO `games` (`gameID`, `name`, `description`, `releaseDate`, `genre`, `developer`, `image`) VALUES
(30, 'The Witcher 3: Wild Hunt', 'Es un videojuego de rol desarrollado y publicado por la compañía CD Projekt RED. Fue anunciado en febrero de 2013 y su lanzamiento tuvo lugar a nivel mundial el 19 de mayo de 2015 para PlayStation 4, Xbox One, Microsoft Windows para después llegar a Nintendo Switch el 15 de octubre del 2019. El juego es la tercera parte de la saga, precedido por The Witcher y The Witcher 2: Assassins of Kings, las cuales están basadas en la saga literaria de Geralt de Rivia escrita por Andrzej Sapkowski.', '2015-05-19', 'RPG', 'CD Projekt RED', );

